import React from 'react';
import './App.css';
import Question from './Question';
import questionData from './question-data.json';

function App() {

  return (
    <div className="App">
      <center>
        <h1>Jeopardy</h1>
      </center>
      <div className="board">
          {/* Column - 1 (History) */}
          <div className="column">
            <h1>History</h1>
            {
              questionData.map((num, i) => {
                if (i % 2 !== 0) {
                  return (
                    'hello'
                  )
                }
                return (
                  <Question
                    key={num + i}
                    clue={questionData[num].clue}
                    answer={questionData[num].answer}
                  />
                )
              })
            }
          </div>
      </div>
    </div>
  );
}

export default App;
